import axios from 'axios';

export const createDorm = async(value) => {
	return await axios.post(process.env.REACT_APP_API + "/dorm", value);
}

export const listDorm = async(value) => {
	return await axios.get(process.env.REACT_APP_API + "/dorm");
}

export const deleteDorm = async(id) => {
	return await axios.delete(process.env.REACT_APP_API + "/dorm");
}
